import React from 'react';

export default function Card(){
    return(
        <div className = "card-component">
            <figure className = "card-component-image">
                <img className = "card-component-main-img" alt = "Katy Zafares" src = "https://runnersconnect.net/wp-content/uploads/2019/06/Katie-Zaferes-2-by-Tommy-Zaferes-e1560905773494.jpeg"></img>
            </figure>
        </div>
    )
}
